info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of CVE Search CVE Search
  title: CVE Search CVE Search
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Get a JSON with all the vulnerabilities per vendor and a specific
        product
      parameters:
      - description: Vendor Name
        example: microsoft
        in: query
        name: Name
        required: true
        schema: {type: string}
      - description: Product Name
        example: office
        in: query
        name: Name
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: CVE Search Browse CVE
  tmp1:
    post:
      description: Get a JSON of a specific CVE ID
      parameters:
      - description: CVE ID
        example: CVE-2010-3333
        in: query
        name: CVE ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: CVE Search Browse CVE ID
  tmp2:
    post:
      description: Get a JSON with all the products associated to a vendor
      parameters:
      - description: Vendor name
        example: microsoft
        in: query
        name: Name
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: CVE Search Browse Products
  tmp3:
    post:
      description: Get a JSON with all the vendors
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: CVE Search Browse Vendor
  tmp4:
    post:
      description: Get more information about the current databases in use and when
        it was updated
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: CVE Search Get Information
  tmp5:
    post:
      description: Get get a JSON of the last 30 CVEs including CAPEC, CWE and CPE
        expansions
      parameters: []
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: CVE Search Get Last Updated
